import { createTheme, ThemeProvider } from '@mui/material/styles';
import Navbar from './components/Navbar';
import React from "react";
import { Helmet } from "react-helmet";

const theme = createTheme({
  palette: {
    primary: {
      light: '#4f5b62',
      main: '#263238',
      dark: '#000a12',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ffffff',
      main: '#efebe9',
      dark: '#bdb9b7',
      contrastText: '#000',
    },
  },
});

function App() {
  return (
  <>
  <ThemeProvider theme={theme}>
    <Helmet>
          <style>{"body { background-color: secondary.main; }"}</style>
    </Helmet>
    <Navbar/>
  </ThemeProvider>
  </>
  )
}


export default App;
